import React, { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import {
  Box,
  Grid,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  Typography,
  Input,
  IconButton,
  InputAdornment,
} from "@material-ui/core";
import HeaderTask from "./../Home/Tasks/HeaderTask";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";
import { acGetUsersRequest } from "./../../../../Actions";

export default function Users() {
  const [showPassword, setShowPassword] = useState(false);
  const users = useSelector((state) => state.users);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(acGetUsersRequest());
  }, []);

  const onChange = (e) => {
    console.log(e);
  };
  return (
    <Box className="body-admin bgr-admin py-5 px-4" sx={{ minHeight: "100vh" }}>
      <Grid container spacing={1}>
        <Grid item xs={12}>
          <Box className="box">
            <HeaderTask bgr="badge-purple" title="Users" position="start" />
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>
                    <Typography variant="subtitle1" color="initial">
                      STT
                    </Typography>
                  </TableCell>
                  <TableCell>
                    <Typography variant="subtitle1" color="initial">
                      Username
                    </Typography>
                  </TableCell>
                  <TableCell>
                    <Typography variant="subtitle1" color="initial">
                      Email Address
                    </Typography>
                  </TableCell>
                  <TableCell>
                    <Typography variant="subtitle1" color="initial">
                      Password
                    </Typography>
                  </TableCell>
                  <TableCell>
                    <Typography variant="subtitle1" color="initial">
                      Date
                    </Typography>
                  </TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {users.map((user, index) => {
                  return (
                    <TableRow key={index}>
                      <TableCell>{index + 1}</TableCell>
                      <TableCell>{user.username}</TableCell>
                      <TableCell>{user.email}</TableCell>
                      <TableCell>
                        <Input
                          type="text"
                          onChange={onChange}
                          value={user.password}
                          name="password"
                          endAdornment={
                            <InputAdornment>
                              <IconButton
                                onClick={() => setShowPassword(!showPassword)}
                              >
                                {showPassword ? (
                                  <VisibilityIcon />
                                ) : (
                                  <VisibilityOffIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          }
                        />
                      </TableCell>
                      <TableCell>2 Hours Ago</TableCell>
                    </TableRow>
                  );
                })}
              </TableBody>
            </Table>
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
}
